            'search' : function( search ) {
                search = $.trim(search);

                if (!search) return this.list();

                return {
                    success : function(cb) {
                        var result = [];

                        for( var i = 0; i < data.length; i ++ ) {

                            var name = (data[i].content.name[0].given[0] + ' ' + data[i].content.name[0].family[0]).toLowerCase();
                            var searchTerms = search.toLowerCase().split(/[, ]/);


                            var flag = true;
                            for( var j = 0; j < searchTerms.length; j ++ ) {
                                var term = $.trim(searchTerms[j]);
                                if (!term) continue;

                                if (name.indexOf(term) == -1) {
                                    flag = false;
                                    continue;
                                }
                            }

                            if (flag) result.push(data[i]);

                        }

                        cb(result)
                    },
                    error: function(){}
                }
            }
